#include <vector>
#include <iostream>

struct ListNode {
        int val;
        ListNode *next;
        ListNode() : val(0), next(nullptr) {}
        ListNode(int x) : val(x), next(nullptr) {}
        ListNode(int x, ListNode *next) : val(x), next(next) {}
};

ListNode* mergeKLists(const std::vector<ListNode*>& lists) {
        std::vector<int> m;

        for(ListNode *ref : lists)
        {
                while(ref != nullptr)
                {
                        m.push_back(ref->val);
                        ref = ref->next;
                }
        }

        if(!m.empty())
        {
                std::sort(m.begin(), m.end());

                ListNode *head = new ListNode(m.front());
                ListNode *lastNode = head;

                m.erase(m.begin());

                for(const auto &ref : m)
                {
                        lastNode->next = new ListNode(ref);
                        lastNode = lastNode->next;
                }
                return head;
        }
        return nullptr;
}

